				// do the zooming
				var axes = plot.getAxes();
				axes.xaxis.options.min = ranges.xaxis.from;
				axes.xaxis.options.max = ranges.xaxis.to;

				// match up the y-axis
				var ymin = 9e99;
				var ymax = 0;
				for (var i=0; i<d.length; i++) {
					if (d[i][0] > ranges.xaxis.from && d[i][0] < ranges.xaxis.to) {
						if (d[i][1] > ymax)
							ymax = d[i][1];
						if (d[i][1] < ymin)
							ymin = d[i][1];
						}
				}

				var diff = ymax - ymin;
				ymax = ymax + 0.1*diff;
				ymin = ymin - 0.1*diff;
				if (ymin < 0)
					ymin = 0;

				axes.yaxis.options.min = ymin;
				axes.yaxis.options.max = ymax;

				// activate
				plot.setupGrid();
				plot.draw();
				plot.clearSelection();

				$("<div class='button' style='right:20px;top:20px'>zoom out</div>")
					.appendTo(placeholder)
					.click(function (event) {
						event.preventDefault();		
						plot = $.plot("#placeholder", [d], options);
					});
				});
			});

		</script>
</head>
<body>
<div id="placeholder"></div>
</body>
</html>
